{"type":"text","text":{"value":"Las funciones en TypeScript correspondientes a las especificaciones proporcionadas son:

1. Función para `tendencia decreciente` con pérdida del `20%` sobre `Nmax`:
```typescript
function FuncionCriterio(Nmax: number): boolean {
    return Nmax * (1 - 0.2) < Nmax;
}
```

2. Función para `tendencia decreciente` con pérdida del `80%` sobre `Nmax`:
```typescript
function FuncionCriterio(Nmax: number): boolean {
    return Nmax * (1 - 0.8) < Nmax;
}
```

3. Función para `tendencia creciente` con ganancia del `20%` sobre `Nmin`:
```typescript
function FuncionCriterio(Nmin: number): boolean {
    return Nmin * (1 + 0.2) > Nmin;
}
```

4. Función para `tendencia creciente` con ganancia del `80%` sobre `Nmin`:
```typescript
function FuncionCriterio(Nmin: number): boolean {
    return Nmin * (1 + 0.8) > Nmin;
}
```

Estas funciones pueden ser ejecutadas usando la instrucción `eval` en un entorno de ejecución de TypeScript.","annotations":[]}}
